import s from './Slider.module.css'
import Carousel from './Carousel/Carousel'

function Slider(){
    return(
        <Carousel>
            <div className={s.item} id={s.item1}>Item1</div>
            <div className={s.item} id={s.item2}>Item2</div>
            <div className={s.item} id={s.item3}>Item3</div>
        </Carousel>
    )
}

export default Slider;
